import React from "react";
import { Form } from "react-bootstrap";

function MessageForm() {
  function handleSubmit(e) {
    e.preventDefault();
  }
  return (
    <div className="messages-output">
      <Form onSubmit={handleSubmit}></Form>
    </div>
  );
}

export default MessageForm;
